import React from 'react';
import Sidebar from './Components/sideBar/sideBar.jsx';
import Content from './Components/content/content.jsx';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <Sidebar />
        <Content/>
      </div>
    </div>
  );
}
export default App;
